    false,nt"url": null,nt"notes": "NODC Accession 0112254 includes chemical,
    discrete sample, physical and profile data collected from MIRAI in the North Pacific
    Ocean from 2000-01-05 to 2000-02-06 and retrieved during cruise MR00-K01 and PACIFICA_49NZ20000105.
    These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
    HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE
    and pH. The instruments used to collect these data include CTD, Coulometer for DIC
    measurement and bottle. These data were collected by Akihiko Murata and Makio Honda
    of Japan Agency for Marine-Earth Science and Technology (Jamstec) as part of the
    PACIFICA_49NZ20000105 data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an
    international collaborative project for the data synthesis of ocean interior carbon
    and its related parameters in the Pacific Ocean. The North Pacific Marine Science
    Organization (PICES), Section of Carbon and Climate (S-CC) supported the project.",nt"owner_org":
